@Component({
  selector: 'app-header',
  imports: [],
  templateUrl: './header.component.html',
  styleUrl: './header.component.css'
})
export class HeaderComponent {

}
<section class="flex-container">
<div>
    <h1>Cocktail Chronicles</h1>
</div>

<div>
    <p>I would like to give thanks to TheCocktailDB for letting me use their api for my portfolio project. Their website can be found at <a href="https://www.thecocktaildb.com/" target="blank">https://www.thecocktaildb.com/</a></p>
</div>

<div>
<p>Search by name or ingredient! For more information click on the desired cocktail!</p>
</div>
</section>
